from typing import List

class Solution:
    def replaceElements(self, arr: List[int]) -> List[int]:
        """
        solution #1
        1. iterate over elements of array
        2. for each element, find the maximum value from its right elements
        3. replace current element with maximum element. 
        
        solution #2
        1. iterate over elements of array from the end
        2. keep maximum value from the end and its index
        3. replace all elements until this maximum index
        
        
    
                    
        [18,6,6,6,1,1]
                    ^
        
        10, 9
        O(n^2) - time, O(1) - space
        """
        def find_max_right(arr, i):
            if i == len(arr) - 1:
                return -1, i
            end = len(arr) - 1
            max_value = arr[end]
            index = end
            end -= 1
            while end > i:
                if arr[end] > max_value:
                    max_value = arr[end]
                    index = end
                end -= 1
        # max_value = 10, index = 9
            return max_value, index
        
        i = 0
        while i < len(arr):
            max_value, index = find_max_right(arr, i) # 6, 4
            # replace all elements from i to index with max_value
            if max_value == -1 and index == len(arr) - 1:
                arr[i] = -1
                break
            while i < index:
                arr[i] = max_value
                i += 1
        return arr
    
    
    

